<div id="About" class="w3-row-padding w3-white w3-padding-64 w3-container">
	<div class="w3-content">
			<h2>About</h2>
			<div class="w3-row">
				<p style="text-align: justify;">MHC-FIS-LdDB is a database of peptides (<i>L. donovani</i> proteome) categorized by the fuzzy inference system. The categorization is based on the six different epitope features including normalized score based on binding prediction of 27 major alleles by four different machine learning tools, normalized score from prediction of T-cell propensity, normalized score from prediction of pro-inflammatory response, normalized score form proteasome cleavage prediction, normalized score of TAP transport efficiency, and normalized score based on BLSAT continuous similarity with human proteins. A total of 60 fuzzy rules were implemented to determine the probable epitope for the peptide: "Low", "Moderate", "High", or "Very High". The database has easy search capabilities and gives complete access to data. Click "Know more" for the detailed method.</p>
			</div> 
			<div class="w3-center">
				<a href="https://mhcfisld.biomedinformri.com/index.php" class="w3-button w3-blue">Know More</a>
				<div class="w3-large w3-padding-16">
