        '</tr>'+
        '<tr>'+
			'<td>BLAST Score:</td>'+
            '<td>'+d.BLAST_Score+'</td>'+
			'<td>Proinflammatory Score:</td>'+
            '<td>'+d.Proinflammatory_Score+'</td>'+
			'<td>Proteosomal clevage Score:</td>'+
            '<td>'+d.PC+'</td>'+

